import React from 'react';
import { Container, Row, Col } from 'reactstrap';

const Unauthorized = () => {
    return(
       <div>
           <Container>
               <Row><br /><br /></Row>
               <Row>
                   <Col md={{size: 6, offset: 3}}>
                        <h1 style={{color: "red", textAlign:"center"}}>You Are not Authorized to View this Page!</h1>
                   </Col>
               </Row>
            </Container>    
       </div>
    )
}

export default Unauthorized;
